export default function Todo(props) {
    return (
        <li className="todo-item"> 
        <div className="todo-outer-circle">
          <input id={props.id} className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"} />

        </div>
        <label style={{ textDecoration: props.completed ? "line-through" : "" }} className="todo-text">
          {props.name}</label>
        <button className="todo-delete"></button>
      </li>
    );
}
